INSERT INTO `gs_templates` VALUES (1,'account_registration','english','Registration at %SERVER_NAME%','Hello,\n\nThank you for registering at %SERVER_NAME%.\n\nAccess to GPS server: %URL_LOGIN%\n\nUsername: %USERNAME%\nPassword: %PASSWORD%'),(2,'account_registration_au','english','Registration at %SERVER_NAME%','Hello,\n\nThank you for registering at %SERVER_NAME%.\n\nDesktop access:\n%URL_AU%\n\nMobile access:\n%URL_AU_MOBILE%'),(3,'account_recover_url','english','Lost login recovery to %SERVER_NAME%','Hello,\n\nA request has been made to recover account on %SERVER_NAME%.\n\nUse the link to complete the process: %URL_RECOVER%'),(4,'account_recover','english','Lost login recovery to %SERVER_NAME%','Hello,\n\nAccess to GPS server: %URL_LOGIN%\n\nUsername: %USERNAME%\nPassword: %PASSWORD%'),(5,'expiring_objects','english','Expiring objects','Hello,\n\nSome of your objects activation will expire soon. Please login into account for more details.\n\nIf you would like to continue using our service, please purchase access to %SERVER_NAME% at our shop:\n%URL_SHOP%'),(6,'event_email','english','%NAME% - %EVENT%','Hello,\n\nThis is event message, please do not reply to this message.\n\nObject: %NAME%\nEvent: %EVENT%\nPosition: %G_MAP%\nSpeed: %SPEED%\nTime (position): %DT_POS%'),(7,'event_sms','english','%NAME% - %EVENT%','Hello,\nObject: %NAME%\nEvent: %EVENT%\nPosition: %LAT%, %LNG%\nSpeed: %SPEED%\nTime (position): %DT_POS%'),(8,'expiring_account','english','Expiring account','Hello,\n\nYour account will expire soon. Please contact us for more details.'),(9,'database_backup','english','Database backup','Hello,\n\nThis is database backup, please do not reply to this e-mail.'),(10,'schedule_reports','english','Schedule reports','Hello,\n\nThis is schedule report message, please do not reply to this e-mail.'),(11,'account_registration','spanish','Registro a %SERVER_NAME%','Hola,\n\nGracias por registrarse a %SERVER_NAME%.\n\nAcceso a monitoreo: %URL_LOGIN%\n\nUsuario: %USERNAME%\nContraseña: %PASSWORD%'),(12,'account_registration_au','spanish','Registro a %SERVER_NAME%','Hola,\n\nGracias por registrarse a %SERVER_NAME%.\n\nAcceso Web:\n%URL_AU%\n\nAcceso Móvil:\n%URL_AU_MOBILE%'),(13,'database_backup','spanish','Copia de seguridad','Hola,\n\nEsta es una copia de seguridad de la base de datos, no responda a este correo electrónico.\n'),(14,'event_sms','spanish','%NAME% - %EVENT%','Hola, \n\nHemos detectado una alerta en su Dispositivo GPS.\n\nObjeto: %NAME%\nPlaca: %PL_NUM%\nEvento: %EVENT%\nPosición: %LAT%, %LNG%\nVelocidad: %SPEED%\nHora (posición): %DT_POS%\n\nSi desea visualizarlo en el mapa,  por favor de clic en este enlace: %G_MAP%'),(15,'event_email','spanish','Alerta - %EVENT%','Hola, \n\nHemos detectado una alerta en su Dispositivo GPS.\n\nObjeto: %NAME%\nPlaca: %PL_NUM%\nEvento: %EVENT%\nPosición: %LAT%, %LNG%\nVelocidad: %SPEED%\nHora (posición): %DT_POS%\n\nSi desea visualizarlo en el mapa,  por favor de clic aqui: %G_MAP%'),(16,'expiring_account','spanish','Cuenta expirada','Hola,\n\nSu licencia de monitoreo satelital caducará pronto. Por favor, póngase en contacto con nosotros para más detalles.'),(17,'expiring_objects','spanish','Dispositivo expirado','Hola,\n\nUno de sus dispositivos GPS caducará pronto. \n\nPor favor, póngase en contacto con nosotros para más detalles.'),(18,'account_recover_url','spanish','Recuperación de inicio de sesión %SERVER_NAME%','Hola,\n\nSe ha realizado una solicitud para recuperar la cuenta en %SERVER_NAME%.\n\nUse el siguiente link para completar el proceso: %URL_RECOVER%'),(19,'account_recover','spanish','Recuperación de inicio de sesión perdida en %SERVER_NAME%','Hola,\n\nAcceso a Global Tracking EC: %URL_LOGIN%\n\nUsuario: %USERNAME%\nContraseña: %PASSWORD%'),(20,'schedule_reports','spanish','Programar informes','Hola,\n\nEste es un mensaje de informe de programación, no responda a este correo electrónico.');
